  const [doctors, setDoctors] = useState(
    [
      {
        id: 1,
        provider_full_name: "Dr. Rodriguez",
        specialty: "Quirofano"
      },
      {
        id: 2,
        provider_full_name: "Dr. Santiago",
        specialty: "Pediatra"
      },
      {
        id: 3,
        provider_full_name: "Dr. Davila",
        specialty: "Cirugia"
      }
    ]
  )

  //Set Appointment
  const setAppointment = (doctor) => {
      console.log("Doctor: " + doctor)
    props.history.push({
        pathname: '/appointment',
        state: doctor});
  }

  const addDoctor = () => {
      console.log("Add Doctor");
      props.history.push('/adddoctor');
  }
  //const [placeholder, setPlaceholder] = useState('Hi');

  // useEffect(() => {
  //   fetch('/hello').then(res => res.json()).then(data => {
  //     setPlaceholder(data.result);
  //   });
  // }, []);

  //console.log(doctors);
  return (
      <div className="App">
        <Doctors doctors={doctors} setAppointment={setAppointment}/>
        <button style={buttonStyle} onClick={ addDoctor }>Add Doctor</button>
      </div>
  );
}

const buttonStyle = {
    background: '#FFF',
    color: '#000',
    border: '1px solid',
    padding: '5px 9px',
    borderRadius: '10',
    display: 'flex',
    justifyContent: "center",
    margin: '0 auto',
    marginTop: '20px'

  }

export default Home;
